    return(
        <div className="card">
            <div className="list-group list-grou-flush ">
                <Link to="/corporate-dashboard" className="list-group-item list-group-item-action">Training Dashboard</Link>
                <Link to="/teacher-profile-setting" className="list-group-item list-group-item-action">Scheduled Classes</Link>
                <Link to="/teacher-courses" className="list-group-item list-group-item-action">Recommended Courses</Link>
            </div>
        </div>
    )
}

export default CorpSidebar;
